import React from "react";
import "./style.css";

function Directory() {
  return (
    <div>
      <div class="container-fluid ">
        <div class="jumbotron bg-warning text-center border border-dark">
          <h1>Employee Directory</h1>
          <p>Search by Employee Name or Phone Number to view their contact.</p>
        </div>
        <p>This is some text.</p>
        <p>This is another text.</p>
      </div>
      <div class="container">
        <div class="row"></div>
      </div>
    </div>
  );
}

export default Directory;
